import React from 'react'

class Display extends React.Component{
    constructor(props) {
        super(props);
        this.state = { rows: this.props.rows };
      }


    render() {
        return (
            <div>
                <h1>Display would be done here {this.state.rows}</h1>
            </div>
        )
    }
}

export default Display;
